import React from 'react';

import About from './About';
import Projects from './Projects';
import Contact from './Contact';
import './Home.css';


const Home = () => {
    return (
        <div className="App">
            <About />
            <Skills />
            <Projects />
            <Contact />
        </div>
    );
};

export default Home;
